import Layout from '../components/Layout';

const Index = (props) => (
  <Layout>
    <div>
      
      <img 
                    src="https://cdn2.iconfinder.com/data/icons/people-flat-design/64/Man-Person-People-Avatar-User-Happy-512.png"
                    alt="avatar"
                    className="avatar-img"
                    />
      
    </div>
    
  </Layout>
);

export default Index;
